import {useState} from 'react';


const StatsDisplay = ({stats}) => {
    console.log(stats);
    const [currency,setCurrency] = useState('standard');

    return (
        <div>
          <ul>
              {stats[currency].map((name) =>
                  <li key={name.personId}>
                      {name.firstName +" "+
                      name.lastName}
                  </li>
              )}

          </ul>
        </div>
    );
};
export default StatsDisplay;
